&quot;RENTA JOVEN ES UN PROGRAMA DE PROSPERIDAD SOCIAL QUE BUSCA LA INCLUSIÓN SOCIAL Y ECONÓMICA DE JÓVENES EN POBREZA Y VULNERABILIDAD. SU OBJETIVO ES FACILITAR EL ACCESO Y LA PERMANENCIA EN LA EDUCACIÓN SUPERIOR DE LOS JÓVENES DEL PAÍS, ADEMÁS DE FORTALECER LAS TRAYECTORIAS DE VIDA MEDIANTE LA ENTREGA DE TRANSFERENCIAS MONETARIAS.

ACTUALMENTE NO HAY CONVOCATORIAS ABIERTAS PARA INSCRIPCIONES DEBIDO A LA ASIGNACIÓN PRESUPUESTAL DE 2025. CUALQUIER NOVEDAD SERÁ INFORMADA A TRAVÉS DE LOS CANALES OFICIALES DE PROSPERIDAD SOCIAL.

LE INVITAMOS A MANTENER ACTUALIZADOS LOS DATOS DE SU HOGAR EN SU CENSO POBLACIONAL CON SU AUTORIDAD INDÍGENA, SISBÉN IV O ICBF, SEGÚN APLIQUE Y ESTAR PENDIENTE POR MEDIO DE NUESTROS CANALES DE ATENCIÓN OFICIALES, TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

&quot;ME PERMITO INFORMARLE QUE SU HOGAR FUE SELECCIONADO COMO BENEFICIARIO DEL PROGRAMA DE COMPENSACIÓN DEL IVA, TAMBIÉN CONOCIDO COMO DEVOLUCIÓN DEL IVA.
ES IMPORTANTE TENER EN CUENTA QUE ESTA CONDICIÓN SE EVALÚA EN CADA CICLO OPERATIVO Y NO TIENE CARÁCTER PERMANENTE. POR LO TANTO, NO SE GARANTIZA LA CONTINUIDAD EN LA RECEPCIÓN DE LA TRANSFERENCIA MONETARIA EN FUTUROS CICLOS.
LE INVITAMOS A MANTENERSE EN CONTACTO CON NOSOTROS PARA VALIDAR OPORTUNAMENTE EL ESTADO DE SU HOGAR EN EL PRÓXIMO CICLO DE PAGOS DEL PROGRAMA.&quot;

&quot;RENTA JOVEN ES UN PROGRAMA DE PROSPERIDAD SOCIAL QUE BUSCA LA INCLUSIÓN SOCIAL Y ECONÓMICA DE JÓVENES EN POBREZA Y VULNERABILIDAD. SU OBJETIVO ES FACILITAR EL ACCESO Y LA PERMANENCIA EN LA EDUCACIÓN SUPERIOR DE LOS JÓVENES DEL PAÍS, ADEMÁS DE FORTALECER LAS TRAYECTORIAS DE VIDA MEDIANTE LA ENTREGA DE TRANSFERENCIAS MONETARIAS.

ACTUALMENTE NO HAY CONVOCATORIAS ABIERTAS PARA INSCRIPCIONES DEBIDO A LA ASIGNACIÓN PRESUPUESTAL DE 2025. CUALQUIER NOVEDAD SERÁ INFORMADA A TRAVÉS DE LOS CANALES OFICIALES DE PROSPERIDAD SOCIAL.

LE INVITAMOS A MANTENER ACTUALIZADOS LOS DATOS DE SU HOGAR EN SU CENSO POBLACIONAL CON SU AUTORIDAD INDÍGENA, SISBÉN IV O ICBF, SEGÚN APLIQUE Y ESTAR PENDIENTE POR MEDIO DE NUESTROS CANALES DE ATENCIÓN OFICIALES, TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

&quot;
LE INFORMO QUE EL PILAR SOLIDARIO ES UNA PARTE FUNDAMENTAL DE LA REFORMA PENSIONAL PROPUESTA POR EL GOBIERNO NACIONAL. 

SU OBJETIVO ES ENTREGAR UNA RENTA BÁSICA MENSUAL A LAS PERSONAS MAYORES QUE NO TIENEN UNA PENSIÓN, CON EL FIN DE REDUCIR LA POBREZA EXTREMA Y GARANTIZAR UNA VEJEZ DIGNA. ESTE INGRESO SERÁ DE APROXIMADAMENTE 230.000 PESOS MENSUALES Y BUSCA RECONOCER EL ESFUERZO DE QUIENES HAN TRABAJADO TODA SU VIDA, AUNQUE NO HAYAN COTIZADO LO SUFICIENTE PARA PENSIONARSE.

ESTE BENEFICIO LLEGARÁ A MÁS DE 3 MILLONES DE PERSONAS MAYORES, Y SE FINANCIARÁ CON RECURSOS DEL PRESUPUESTO GENERAL DE LA NACIÓN Y EL FONDO DE SOLIDARIDAD PENSIONAL.

RECOMENDAMOS MANTENER ACTUALIZADA SU INFORMACIÓN EN LA ENCUESTA DEL SISBÉN Y EN OTRAS BASES OFICIALES DE POBLACIÓN VULNERABLE. LE INVITAMOS A CONSULTAR FRECUENTEMENTE LOS CANALES DE ATENCIÓN DE PROSPERIDAD SOCIAL PARA ENTERARSE DE FECHAS Y PASOS A SEGUIR CUANDO EL PROGRAMA INICIE. &quot;

* FREIMAR AL MENOS UN INTEGRANTE DEL HOGAR, ENTRE 14 Y 17 AÑOS, NO ESTÁ GRADUADO DE LA EDUCACIÓN MEDIA Y TAMPOCO SE ENCUENTRA MATRICULADO EN ELLA.

*SU HOGAR ACTUALMENTE REPORTA EN ESTADO ACTIVO(A) EN LA LÍNEA DE INTERVENCIÓN VALORACIÓN DE CUIDADO
