&quot;RENTA CIUDADANA ES UN PROGRAMA QUE BUSCA CONTRIBUIR A LA SUPERACIÓN DE LA POBREZA, FOMENTAR LA MOVILIDAD SOCIAL Y FORTALECER LA ECONOMÍA POPULAR. PARA LOGRARLO, SE ENTREGAN TRANSFERENCIAS MONETARIAS CONDICIONADAS Y NO CONDICIONADAS A HOGARES EN SITUACIÓN DE POBREZA EXTREMA Y MODERADA, CLASIFICADOS EN LOS GRUPOS A Y B DEL SISBÉN IV.
&quot;RENTA CIUDADANA BUSCA APOYAR A HOGARES EN POBREZA EXTREMA Y MODERADA (GRUPOS A Y B DEL SISBÉN IV) MEDIANTE TRANSFERENCIAS MONETARIAS CONDICIONADAS. ACTUALMENTE, ACOMPAÑAMOS LA LÍNEA DE VALORACIÓN DEL CUIDADO, DIRIGIDA A HOGARES DEL GRUPO (A) QUE CUENTEN CON UNA SOLA JEFATURA, CON NIÑOS MENORES DE 6 AÑOS O PERSONAS CON DISCAPACIDAD QUE REQUIEREN CUIDADOR.

EL PROGRAMA NO MANEJA INSCRIPCIONES; PROSPERIDAD SOCIAL IDENTIFICA Y VINCULA A LOS POTENCIALES BENEFICIARIOS SEGÚN CRITERIOS Y LA INFORMACIÓN REGISTRADA DEL HOGAR EN  LAS FUENTES OFICIALES. POR ESO, ES CLAVE MANTENER ACTUALIZADOS LOS DATOS EN EL SISBÉN, YA QUE LA SELECCIÓN SE REVISA CADA SEMESTRE.&quot;

&quot;
